  false,\n\t\"url\": null,\n\t\"notes\": \"The Fallon, Stillwater and Anaho Island
  National Wildlife Refuges are located in northwest Nevada and are administered by
  the refuge administrative office in Fallon, Nevada. Together they comprise the Stillwater
  Wildlife Management Area (SWMA). The near normal weather conditions in 1975 had
  no significant affect on refuge outputs and operations. At the beginning of the
  year seven of the fourteen marsh units were dry. With the hot months of July and
  August ahead, and no expectations of increased water deliveries, it was felt that
  Stillwater would be providing very little in the way of waterfowl habitat during
  the forthcoming year. The unexpected did occur when late snowstorms hit the area.
  Marsh habitat was poor during the first half of the year but an increased water
  supply in June increased habitat acreage. Overall, waterfowl use was down due to
  decreased habitat caused by an inadequate water supply during the first half of
  the year. There was no development during the reporting period and all maintenance
  was routine in nature. Much of the Area continues to be badly overgrazed. Due to
  a reduction in water receipts most of the developed pasture was left unwatered.\",\n\t\"owner_org\":
